  false,\n\t\"url\": null,\n\t\"notes\": \"This cruise will collect samples and observations
  in the DEEP-C benthic array of sites. Leg I will depart St Petersburg 08:00 22 Sept
  2012, change personnel in Panama City at 08:00 on 30 Sept. Leg 2 will return to
  Panama City at 08:00 7 October. Equipment requested from FIO: CTD-Rosette, 12kHz
  depth profiling display, 50x50cm box-core(back-up). Equipment requested from USF:
  8-barrel multicore and core-processing equipment(Hollander), USBL system (Locker),
  Chest freezer. Equipment provided by FSU: MILET photo platform. Leg 1 will prioritize
  photo survey of all sites with selected multicore collections at the shallow (<
  1000m sites). Leg 2 will prioritize multicore and water sample collections with
  no scheduled seafloor imaging.nnThis dataset contains the data from the CTD casts
